const SearchStores = (props) => {

    return ( 
        <div>
            <label htmlFor="stores">Ingrese ID de Store</label>
            <input type="text" />
            <button onClick={props.setLink("openWidget")}>Volver</button>
        </div>
     );
}
 
export default SearchStores;
